860373_138512651002798_2534929355658146741_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=LaoCpEM1YSIAX-bndbI\u0026oh=4cd8d6d1bc1af9926f377458cd60a028\u0026oe=5E9CB2D4","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c0.180.1440.1440a/s480x480/89860373_138512651002798_2534929355658146741_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=LaoCpEM1YSIAX-bndbI\u0026oh=944e74b5f924dda1a6863bbd3c454873\u0026oe=5E9DFB8E","config_width":480,"config_height":480},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/89860373_138512651002798_2534929355658146741_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=LaoCpEM1YSIAX-bndbI\u0026oh=dc54ceae0ab79d6543d224f090c73ac8\u0026oe=5E9AFCEF","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":"Photo by Alma Mae Maglasang Baterna \ud83d\udcda\ud83d\udd8b in Lamintak Norte, Medellin with @simplydresses, @lightroom, @tutorial.lightroomcc, @lrclass_ph, and @mackytravel_presets. \u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a1 \u4f4d\u7528\u6237\u3001\u7ad9\u7acb\u548c\u978b"}},{"node":{"comments_disabled":false,"__typename":"GraphImage","id":"2265685468876089937","edge_media_to_caption":{"edges":[{"node":{"text":"In order to heal our mental and\u00a0emotional body\u00a0to overcome deep fears, we must know how to establish safety within ourselves and recognize what makes us feel unsafe. Taking good care of our body, having a consistent meditation or spiritual practice to become more inner directed, avoiding exposure to self-harming behaviors, and learning how to manage fear or trauma reactions is essential to being safe within yourself. The first step is to identify what makes us feel safe and stable and to do those things every day. We must make an effort to identify what choices we do have, and make changes in our environment that can increase our sense of safety and comfort while in our physical space. Assess the physical and emotional safety of your environment, and realize it may be necessary to remove yourself from situations in your life that are entrenched in\u00a0destructive and harmful behaviors, in order to make the necessary changes to your lifestyle. When we are more competent in\u00a0Emotional Self-Regulation\u00a0our inner safety is enhanced, so that\u00a0trust can be formed, as we discover that we really do have the resources inside of us for feeling comforted and safe. - Lisa Renee \u00b7\n\u25ab\u25ab\n\u25ab\n#conscioustimeline #spiritual #mindbodyspirit #raiseyourvibration #higherconsciousness #awaken #ascension #freeyourmind #collectiveconsciousness #dropknowledge #enlightenment #5d #thegreatawakening #ascensionpath #multidimensional #higherself #newearth #servicetoothers #liveyourtruth #lookwithin #loveyourself #letgooffear #overcomeyourfears #believeinyourself #unityconsciousness #loveistheanswer #love #kindness #compassion #wereallinthistogether"}}]},"shortcode":"B9xVO4JH6pR","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584310776,"dimensions":{"height":480,"width":480},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90051278_152291585959202_1945580763535325859_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=pMbfXpCCSdsAX9lNs7n\u0026oh=85a6de736971f8d06be2ba9001543f06\u0026oe=5E9D1A53","edge_liked_by":{"count":5},"edge_media_preview_like":{"count":5},"owner":{"id":"2701476391"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/90051278_152291585959202_1945580763535325859_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=102\u0026_nc_ohc=pMbfXpCCSdsAX9lNs7n\u0026oh=85a6de736971f8d06be2ba9001543f06\u0026oe=5E9D1A53","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/90051278_152291585959202_1945580763535325859_n.jpg?_nc_  Puri\ud83e\uddda\u200d\u2640\ufe0f on March 15, 2020. \u56fe\u7247\u4e2d\u53ef\u80fd\u6709\uff1a2 \u4f4d\u7528\u6237\u3001\u4e00\u7fa4\u4eba\u7ad9\u7740"}},{"node":{"__typename":"GraphImage","id":"2265658944894343633","edge_media_to_caption":{"edges":[{"node":{"text":"Dzisiaj znowu przychodz\u0119 do was z nieco d\u0142u\u017cszym postem. \u201eJak mam w ko\u0144cu siebie zaakceptowa\u0107?\u201d- zadawa\u0142am sobie to pytanie niemal\u017ce codziennie przez kilka lat. \nCzym w\u0142a\u015bciwie jest samoakceptacja? My\u015bl\u0119, \u017ce jest to termin, kt\u00f3ry ka\u017cdy interpretuje na sw\u00f3j spos\u00f3b, jednak dla mnie jest ona pocz\u0105tkiem drogi do osi\u0105gni\u0119cia sukcesu/marze\u0144. \nPoni\u017cej opisze sposoby (kt\u00f3re s\u0105 oparte na moim w\u0142asnym do\u015bwiadczeniu), kt\u00f3re pomog\u0142y mi w zaakceptowaniu siebie.\n1.Zacznijcie robi\u0107 to, co naprawd\u0119 lubicie i w czym czujecie si\u0119 dobrzy. Kiedy zaczniecie, \u0142atwiej zacznie wam przychodzi\u0107 chwalenie lub wynagradzanie siebie. Jest to bardzo wa\u017cna czynno\u015b\u0107, poniewa\u017c osi\u0105gaj\u0105c co\u015b, potrzebna jest satysfakcja. \n2. Nie b\u00f3jcie si\u0119 zmienia\u0107 swojego wygl\u0105du. Przefarbujcie w\u0142osy, zmie\u0144cie spos\u00f3b malowania lub styl- ubierajcie to, w czym czujecie si\u0119 pi\u0119kni\u2665\ufe0f\n3.Zacznijcie dostrzega\u0107 swoje zalety oraz wyeliminujcie my\u015bli typu \u201enie uda mi si\u0119\u201d. Na pewno dostrze\u017cecie chocia\u017c jedn\u0105 rzecz, kt\u00f3ra wam si\u0119 podoba- skupcie si\u0119 na niej i postrzegajcie j\u0105 jako sw\u00f3j atut. Kiedy znajdziecie ju\u017c jedn\u0105, \u0142atwiej szuka\u0107 dalej. \nPami\u0119tajcie o tym, \u017ceby nie dawa\u0107 kontroli swoim negatywnym my\u015blom. Zazwyczaj jest to reakcja obronna przed zmianami, kt\u00f3re nie zawsze s\u0105 dla nas wygodne. Nie poddawajcie si\u0119 i wytrwale d\u0105\u017ccie do swoich cel\u00f3w, wierzcie mi \u017ce po pewnym czasie zauwa\u017cycie u siebie wewn\u0119trzny spok\u00f3j i mas\u0119 pozytywnej energii.\n\n#me #selfie #selfietime #dailyselfie #brunette #brunettegirl #sunnyday #goldenhour #beautiful #love #instaphoto #instagood #greeneyes #naturalmakeup #instagirl #polishgirl #poland #weekend"}}]},"shortcode":"B9xPM5wnRnR","edge_media_to_comment":{"count":6},"taken_at_timestamp":1584307614,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/89719916_215063003179985_5355071946108939452_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=aAE8jQPDesUAX9oqa9y\u0026oh=b4e8b571fe02809f359d1b21f8f85d09\u0026oe=5E9CF74E","edge_liked_by":{"count":227},"edge_media_preview_like":{"count":227},"owner":{"id":"1368206230"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89719916_215063003179985_5355071946108939452_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=aAE8jQPDesUAX9oqa9y\u0026oh=2b9db0f3a5db5c5ed538e7616b538e79\u0026oe=5EA560F9","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89719916_215063003179985_5355071946108939452_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=aAE8jQPDesUAX9oqa9y\u0026oh=0cedc0beea262f449934da1b42c988a4\u0026oe=5EA6185E","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89719916_215063003179985_5355071946108939452_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=aAE8jQPDesUAX9oqa9y\u0026oh=2e79acc6be9d17326671e383c375c568\u0026oe=5EA16C14","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/89719916_215063003179985_5355071946108939452_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=105\u0026_nc_ohc=aAE8jQPDesUAX9oqa9y\u0026oh=c322434bb83
